import { Card, Col, Row } from "react-bootstrap";

function Loading() {
  return (
    <Row>
      <Col className="mt-4">
        <Card>
          <Card.Body>
            <Card.Title>Loading...</Card.Title>
          </Card.Body>
        </Card>
      </Col>
    </Row>
  );
}

export default Loading;
